          </TouchableOpacity>

          <TouchableOpacity style={styles.item} onPress={() => {}}>
            <SvgUri
              width={42}
              height={42}
              uri="http://192.168.0.112:3333/uploads/baterias.svg"
            />
            <Text style={styles.itemTitle}>Baterias</Text>
          </TouchableOpacity>

          <TouchableOpacity style={styles.item} onPress={() => {}}>
            <SvgUri
              width={42}
              height={42}
              uri="http://192.168.1.10:3333/uploads/baterias.svg"
            />
            <Text style={styles.itemTitle}>Baterias</Text>
          </TouchableOpacity>

          <TouchableOpacity style={styles.item} onPress={() => {}}>
            <SvgUri
              width={42}
              height={42}
              uri="http://192.168.1.10:3333/uploads/baterias.svg"
            />
            <Text style={styles.itemTitle}>Baterias</Text>
          </TouchableOpacity>
        </ScrollView>
      </View>
    </>
  );
};

export default Points;
